import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`
/* Basic style */
    nav {
        display: flex;

        padding: 5px 20px;
        width: 99.9%; /* Look at this later */
        background-color: #D68266;
        margin: 0;

    }
    .item {
        text-align: center;
        width: 100%;
        order: 3;
    }
    .menu {
        justify-content: center;    
    }
    ul {
        padding: 0;
        list-style-type: none;
    }
    .menu li {
        font-size: 16px;
        padding: 15px 5px;
        white-space: nowrap;
    }
    nav li a {
        flex: 1;
        font-family: 'Roboto', sans-serif;
        color: #ffffff;
        text-decoration: none;
    }
`;

const NavBar = () => {
    return ( 
            <Styles>
                <nav>
                    <ul class="menu">
                        <li className="item"> <a href="/test">Home</a> </li>
                        <li className="item"> <a href="/about">About</a> </li>
                        <li className="item"> <a href="/blog">Blog</a> </li>
                        <li className="item"> <a href="/contact">TestContact</a> </li>
                    </ul>
                </nav>
            </Styles>
    )
}

export default NavBar;
